import React from "react";
import Compose from "./Compose";
import "../components/Nav.css";
import { useStateValue } from "../DataContext/DataContext";

const Nav = () => {
  const [{ nav }, dispatch] = useStateValue();

  const NavItem = ({ id, url, title, icon }) => {
    return (
      <li id={id}>
        <img src={icon} />
        {title}
      </li>
    );
  };

  return (
    <nav>
      <Compose />
      {nav.map((item) => (
        <NavItem id={item.id} icon={item.icon} title={item.title} />
      ))}
    </nav>
  );
};

export default Nav;
